import React, { Component } from 'react';

export default class Form extends Components {
    render() {
        return (
            <form>
                <p>
                    <label>Nome</label><br />
                    <input type="text" />
                </p>
                <p>
                    <label>GitHub</label><br />
                    <input type="url" />
                </p>
                <p>
                    <button>Enviar</button>
                </p>

            </form>
        )
    }
}
